INSERT INTO `checklist_items` (`id`, `name`, `position`) VALUES (1,'Has clothing been given to us?',1),(2,'Has the photo for enlargement been given? Is it standard size?',2),(3,'Has the death certificate been given?',3),(4,'Has the cremation slot been booked?',4),(5,'Has the package been explained?',5),(6,'Have you informed the bereaved family that itemisation is also available?',6),(7,'Has the manpower service and embalming charges been explained?',7),(8,'Has the bereaved family been informed about Volvo, Mercedes and E-class Hearse?',8),(9,'Has the usage of parlours been clearly explained?',9),(10,'Has the floral arrangement been made? 5 hours delivery time? Flow in parlour and tentage have different lifespan',10),(11,'Has the storing / transferring ashes procedure been clearly explained to the customer? Including the location to place ashes/waiting period / inscription artwork/purchase of urn ( different columbarium\'s own requirements )',11),(12,'Does the bereaved family intend to place obituary? Or Heaven address? Charity organisations?',12),(13,'Ensure all the deceased details including funeral data and time is correct. Funeral written on whiteboard is correct?',13),(14,'Has the bereaved family signed on the stipulation form? $1000 deposit collected?',14),(15,'Has the bereaved family been informed that the full payment is advised to be settled 2 days before actual funeral day provided the ash is arranged by their own cremation is done by KMS or TTA?',15),(16,'Valet Parking, letter of consent has been issued and signed?',16),(17,'Items to put inside coffin',17),(18,'Any followup',18);
